    false,nt"url": null,nt"notes": "LIDAR data is remotely sensed high-resolution
    elevation data collected by an airborne collection platform. Using a combination
    of laser range finding, GPS positioning and inertial measurement technologies; LIDAR
    instruments are able to make highly detailed Digital Elevation Models (DEMs) of
    the earth's terrain, man-made structures and vegetation. Using a LH Systems ALS50
    Light Detection And Ranging (LiDAR) system, 262 flight lines of high density (submeter
    ground sample distance) data were collected in the northern half of Jefferson County
    in Florida. This data set was collected at the same time as the collection for portions
    of Bay, Calhoun, Jackson and Washington Counties. Collectively, these data sets
    cover approximately 1201 square miles. The Jefferson County project covers approximately
    513 square miles. The data acquisition occurred in 17 missions between February
    22, 2007 and March 13, 2007. Multiple returns were recorded for each laser pulse
    along with an intensity value for each return. This data was collected at sub-meter
    resolution to provide average point spacing of 0.7 m for collected points. Up to
    5 returns were recorded for each pulse in addition to an intensity value.",nt"owner_org":
